import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with different load strategy
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input using different selector strategy
    await page.waitForSelector('input[type="text"]', { timeout: 5000 });

    // Enter XSS payload using different input method
    const xssPayload = '<script>alert("XSS")</script>';
    await page.focus('input[type="text"]');
    await page.keyboard.type(xssPayload);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_xss_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_xss_entered.png'));

    // Click search button using different selector
    await page.click('button.search-btn');

    // Wait briefly for potential execution
    await page.waitForTimeout(1000);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_search.png'));

    // Check if payload appears in page content
    const pageContent = await page.content();
    const xssDetected = pageContent.includes(xssPayload);

    return {
      success: true,
      action: "Attempted XSS injection via search input",
      extractedData: {
        payloadUsed: xssPayload,
        payloadReflected: xssDetected
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete XSS attempt",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
